    false,nt"url": null,nt"notes": "The Lower Souris Migratory Waterfowl Refuge
    (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
    of the Canadian border in North Dakota. The refuge was established and constructed
    by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
    events taking place on the refuge in April of 1937. A summary of the start of the
    waterfowl migration is shared as well as details on nesting. Precipitation is still
    low with the exception of one good soak occurring in the middle of the month. Approximately
    150 to 200 acres of farm land is ready to plant with late varieties of crops. Seed,
    aquatic and tree planting has begun to provide habitat and food for refuge species.
    Predator control efforts have continued, though with less success than in March.
    The report concludes with a photographs section.",nt"license_title": "License
